What i is printed?   public class Test 
{ public static void main(String[] args) {
int j = 0;
int i = ++j + j * 5;

System.out.println("What is i? ," + i);
}
}

Which of the following loops prints "Welcome to Java,CMU Australia" 10 times?

A:
for (int count = 1; count <= 10; count++) {
  System.out.println("Welcome to Java,CMU Australia");
}

B:
for (int count = 0; count < 10; count++) {
  System.out.println("Welcome to Java,CMU Australia");
}

C:
for (int count = 1; count < 10; count++) {
  System.out.println("Welcome to Java,CMU Australia");
}

D:
for (int count = 0; count <= 10; count++) {
  System.out.println("Welcome to Java,CMU Australia");
}
